import ArrowLeftIcon from '@material-ui/icons/ArrowLeft';
import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import ArrowRightIcon from '@material-ui/icons/ArrowRight';
import IconButton from '@material-ui/core/IconButton';
import Button from '@material-ui/core/Button';

export default function VideoUploadDiv(props)
{
    const{handleUploadDiv,handleUploadVideo,uploadProgress,displayFileName,openUpload,formRef} = props;

    return <div className="upload-file" id="upload-file">
        <form onSubmit={handleUploadVideo} ref={formRef}>
        <IconButton
        size="medium"
        onClick={()=>document.getElementById('video').click()}
        style={{color:"white"}}
        >
        <CloudUploadIcon/>
        </IconButton>
        <input type="file" name="video" id="video" hidden onChange={displayFileName}/>
        <Button
        variant="contained"
        color="default"
        type="submit"   
      >
        Upload
      </Button>
        </form>
        <p id="file-name" style={{color:"white"}}></p>
        {uploadProgress&&
        <div className="uploadProgress">   
            <div className="progressBar" id="uploadFileProgress"> 
            </div>
        </div>}
        <IconButton
        size="small"
        id="openUploadDiv"
        onClick={handleUploadDiv}
        >{openUpload?
            <ArrowLeftIcon/>
            :
            <ArrowRightIcon/>
         }
        </IconButton>
    </div>
}
